const main = () => {

    const { TextArea } = Input;
    return (
        <section id="test">
            <div style={{
                backgroundColor: 'white',
                alignItems: 'center',
                position:'fixed',
                padding:'24px',
                display: 'flex',
                width: '100%',
                height:'100%'
            }}>
                <TextArea 
                    rows={4}
                    defaultValue={'Please enter the review'} />
            </div>

        </section>
    );
}

export default main;
